import React from 'react';

const PokemonList = ({pokemon}) => {
    return(
        <div>
            <h2 className="products">Pokemon List</h2>
            {pokemon.map(p => (
                <div className="card" key={Math.random()}>
                <h2>{p.count}</h2>
                <div key={p}>{p}</div>
                </div>
            ))}
        </div>
    )
}

export default PokemonList;
